import { useState } from "react";
import data from "./data";
import "./styles.css";

export default function Accordian(){
    return(
        <div className="wrapper">
            <div className="accordian">
                {
                    data && data.length>0 ?
                    data.map((item)=>
                    <div className="title"> 
                        <h3>{item.question}</h3>
                        <span>+</span>
                    </div>
                    )
                    :<div>No data found</div>
                }

            </div>
        </div>
    )
}
